import React from 'react'
import { Redirect, Route, Switch } from 'react-router-dom'

import {MainPage, StartPage} from './index'

export const useRouter = isAuthenticated => {
    if (isAuthenticated) {
        return(
            <Switch>
                <Route path="/main" exact>
                    <MainPage />
                </Route>
                <Redirect to="/main" />
            </Switch>
        )
    }

    return (
        <Switch>
            <Route path="/main" exact>
                <StartPage />
            </Route>
            <Redirect to="/main" />
        </Switch>
    )
}
